import { useParams } from 'react-router-dom';
import Socket, { socket } from '../socket/socket';

export default function Lobby() {
    const gameId = useParams();
    return (
        <div>
            <div>
                Welcome to online chess!
            </div>

            <div>
                <input type="text" value={window.location} />
            </div>

            <div>
                <p>{gameId.socketId}</p>
            </div>
        </div>
    )
}
